import { directive } from '@babel/types';
import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from '../component/home/Home';
import WatchingVideo from '../component/watching/WatchingVideo'
import NewsFeed from '../component/newsFeed/NewsFeed'
import UserSub from '../component/userSub/UserSub'
export default function DieuHuongUrl() {
    const routes = [
        {
          path: "/",
          exact: true,
          main: () => <Home/>
        },
        {
          path: "/watching",
          main: () => <h2>Bubblegum</h2>
        },
        {
          path: "/shoelaces",
          sidebar: () => <div>shoelaces!</div>,
          main: () => <h2>Shoelaces</h2>
        }
      ];
        return (
            <div>  
                <Switch>
                        
                         <Route path="/watching/:id">
                            <WatchingVideo />
                        </Route>
                        <Route exact="/">
                            <Home />
                        </Route>
                        <Route path="/news">
                            <NewsFeed/>
                        </Route>
                        <Route path="/userSub">
                            <UserSub/>
                        </Route>

                </Switch>
            </div>
           
        )
    }
